(function(){tinymce.create("tinymce.plugins.ImageUploadPlugin",{init:function(a,b){a.addCommand("mceImageUpload",function(){a.windowManager.open({file:b+"../../../../../../admin/mce_upload.php",inline:1,width:350,height:100},{plugin_url:b})});a.addButton("imageupload",{title:"Upload Image",image:b+"/img/upload-image.png",cmd:"mceImageUpload"})},getInfo:function(){return{longname:"Simple Image Upload",author:"enoyhs",version:"0.0.1"}}});tinymce.PluginManager.add("imageupload",tinymce.plugins.ImageUploadPlugin)})()